/**
 * 作者：Mr.wang
 * 时间：2022/4/12
 * 文件名：index
 * 项目名称：脚手架
 * WebStorm
 */
import React, {Component} from "react";

export default class About extends Component {
    render() {
        return (
            <div>
                <div className="col-xs-6">
                    <div className="panel">
                        <div className="panel-body">
                            <h3>我是About的内容</h3>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
